    return (
        <div className="">            
            <h3>Big Block Image (Bored)</h3>
        </div>
    )
}//end method

function ImageText() {
    
    const[bored, setBored] = React.useState()
           
    console.log(bored)
    
    
    function getBored() {        
        fetch(`http://www.boredapi.com/api/activity/`)
            .then(res => res.json())
            .then(data => setBored(data))
    }//end method
    
    
    React.useEffect(
        getBored,
        []        
    )   

    return (
        <h3>{bored}</h3>
    )
}//end method

